import { useNavigate } from 'react-router-dom';
import videoHomePage from '../../assets/video-homepage.mp4'
import { useSelector } from 'react-redux'
import { useTransition,Trans } from 'react-i18next';
const HomePage = () => {
    const isAuthenticated = useSelector(state => state.user.isAuthenticated);
    const navigate = useNavigate();
    const { t } = useTransition();
    return (
        <div className="homepage-container">
            <video autoPlay muted loop>
                <source src={videoHomePage} type="video/mp4">
                </source>
            </video>
            <div className='homepage-content'>
                <div className='title-1'>Branding Questionnaire Template
                </div>
                <div className='title-2'>
                    Discover all you need to know about your clientâ€™s business and brand vision with this free questionnaire.
                </div>
                <div className='title-3'>
                    {isAuthenticated === true ?
                        <button className='btn btn-primary' onClick={()=>navigate('/users')}>Start quiz now</button>
                        : <button className='btn-title-3' onClick={() => navigate('/login')}>Get's started. It free</button>}

                </div>
            </div>
        </div>
    )
}

export default HomePage
